<!DOCTYPE html>
<title>Player Mirror</title>
<link rel="stylesheet" type="text/css" href="https://21shared.com/player/css/main.css" />
<script type="text/javascript" src="https://21shared.com/player/js/jquery.min.js"></script>
<script type="text/javascript" src="//content.jwplatform.com/libraries/0P4vdmeO.js"></script>
<style>
    #myVideo .jw-active-option {
        color: #cccccc !important;
    }

    .jw-dock-image {
        background-size: 70% !important;
        background-size: 70% 70% !important;
    }

    .videocontent,
    #myVideo {
        min-height: 260px;
    }

    @media only screen and (max-width: 450px) {
        .jw-settings-topbar .jw-settings-close {
            margin-right: 30px;
             !important
        }
    }
</style>

</head>

<body>
    <div class="wrapper">
        <div class="videocontent">
            <script>
                $(document).ready(function() {
                    closeServer();
                    var h = 35;
                    //if(bttCount<2) h=1; else {if($(window).width()>(100*bttCount)) h=35; else h=100;}
                    var video = {
                        width: $(window).width(),
                        height: $(window).height() - h
                    };
                    $("#show-server").click(function(e) {
                        e.preventDefault();
                        $(".list-server-items").toggle();
                    });
                    $(".list-server-items li.linkserver").click(function(e) {
                        e.preventDefault();
                        var link = $(this).attr('data-video');
                        var data_status = $(this).attr('data-status');
                        if ($(this).hasClass("active")) {
                            return false;
                        } else {
                            $("iframe").hide();
                            $(".videocontent img").hide();
                            $("iframe").attr('src', '');
                            if (document.getElementById('myVideo')) {
                                if (data_status == 0) {
                                    playerInstance.play();
                                    $("#myVideo").show();
                                } else {
                                    playerInstance.stop();
                                    $("#myVideo").hide();
                                }
                            }

                            if (data_status == 1) {
                                $("#load-iframe").show();
                                $("#load-iframe iframe").show();
                                $("#load-iframe iframe").attr('src', link);
                                $("#load-iframe iframe").html('<iframe src="' + link +
                                    '" frameborder=0 marginwidth=0 marginheight=0 scrolling=no width="' + video
                                    .width + '" height="' + video.height + '" allowfullscreen></iframe>');
                            } else {
                                $("#load-iframe").hide();
                            }
                            closeServer();
                        }
                        $('.list-server-items li').removeClass('active');
                        $(this).addClass('active');
                    });
                    $("#embedvideo").width($(document).width());
                    $("#embedvideo").height($(document).height());
                });

                function closeServer() {
                    setTimeout(function() {
                        $('.list-server-items').fadeOut();
                    }, 5000)
                }
            </script>
            <style>
                .videocontent {
                    position: relative;
                    color: #fff;
                }

                #list-server-more {
                    z-index: 1;
                    padding: 10px 0 0 0;
                    position: absolute;
                    color: #fff;
                    top: 0;
                    right: 8px;
                    text-align: right;
                    font-family: Arial, Helvetica, sans-serif;
                }

                #show-server {
                    color: #000;
                    padding: 5px 15px;
                    font-size: 10px;
                    background: url("data:image/gif;base64,") no-repeat center center;

                }

                .list-server-items {
                    margin-top: 10px;
                    background: rgba(0, 0, 0, .7);
                }

                .list-server-items li {
                    cursor: pointer;
                    padding: 6px 5px 6px 15px;
                    color: #ccc;
                    text-align: right;
                    list-style: none;
                    border-top: solid 1px #20201f;
                    font-size: 13px;
                }

                .list-server-items li.active,
                .list-server-items li:hover {
                    color: #fff;
                }

                #load-iframe {
                    display: none;
                    position: relative;
                }

                .list-server-items li:first-child {
                    border: 0;
                }

                .list-server-items a {
                    color: #ccc;
                    text-decoration: none
                }

                .list-server-items a:hover,
                .list-server-items .active a {
                    color: #FFFFFF;
                }
            </style>
            <div id="list-server-more">
                <a href="javascript:void(0)" id="show-server" title="Show Server"></a>
                <ul class="list-server-items">
                    <li class="active linkserver" data-status="0" data-video=""> P2P(Default)</li>
                    <li class="linkserver" data-status="1" data-video="https://www.kshowid.com/v/36ll0tmwg6362wq">Fembed</li>
                    <li class="linkserver" data-status="1" data-video="https://uptostream.com/iframe/xwfjg975ktp2">Uptobox</li>
                    <li class="linkserver" data-status="1" data-video="https://woof.tube/e/1AGArhNyHnv">Verystream</li>
                    <li class="linkserver" data-status="1" data-video="https://gounlimited.to/embed-ihc6f7hrxwx3.html">Gounlimited</li>
                    <li class="linkserver" data-status="1" data-video="https://rapidvid.to/e/G4F3O1CN3M">Rapidvideo</li>
                </ul>
            </div>
            <div id="load-iframe">

                <iframe id="default" class='embed-responsive-item' style="border:0px #FFFFFF none;" scrolling="no" frameborder="0" marginheight="0px" marginwidth="0px" height="100$" width="100%" allowfullscreen="true" src="" onload="hideLoading()"></iframe>
            </div>

            <iframe id="default" class='embed-responsive-item' style="border:0px #FFFFFF none;" scrolling="no" frameborder="0" marginheight="0px" marginwidth="0px" height="460" width="100%" allowfullscreen="true" src="https://idrakor.com/public/dist/play.html?id=1b842a435d4c397a4117ff34e00bf827" onload="hideLoading()"></iframe>
        </div>

    </div>

</body>

</html>